import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <nav class="navbar navbar-light bg-primary">
        <span class="navbar-brand mb-0 h1">Navbar</span>
      </nav>
    );
  }
}

export default Navbar;
